import React from 'react';
import ExList from '../view/ExList';

class ExListContainer extends React.Component {
  state = {
    object1: {
      id: 'root',
      name: 'Parent',
      children: [
        {
          id: '1',
          name: '1',
        },
        {
          id: '3',
          name: '3',
          children: [
            {
              id: '4',
              name: '4',
            },
          ],
        },
      ],
    },
    object2: {
      id: 'root',
      name: 'Parent',
      children: [
        {
          id: '1',
          name: '1',
        },
        {
          id: '3',
          name: '3',
          children: [
            {
              id: '4',
              name: '4',
            },
          ],
        },
      ],
    },
  };

  render() {
    return (
      <>
        <ExList data={this.state.object1}></ExList>
        <ExList data={this.state.object2}></ExList>
      </>
    );
  }
}

export default ExListContainer;
